import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navigation from './Navigation';

const Home = () => <h2>Home</h2>;
const Introduction = () => <h2>Introduction</h2>;
const VariablesDataTypes = () => <h2>Variables and Data Types</h2>;
const OperatorsExpressions = () => <h2>Operators and Expressions</h2>;

const App = () => {
  return (
    <Router>
      <Navigation />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/introduction" element={<Introduction />} />
        <Route path="/python-basics/variables-data-types" element={<VariablesDataTypes />} />
        <Route path="/python-basics/operators-expressions" element={<OperatorsExpressions />} />
      </Routes>
    </Router>
  );
};

export default App;
